import React from 'react';
import './Expenses.css';

import Expenseitems from './Expenseitems';

function items({ items }) {
  console.log(items);
  return (
    <div className='expenses'>
      <Expenseitems
        title={items[0].title}
        amount={items[0].amount}
        date={items[0].date}
      ></Expenseitems>
      <Expenseitems
        title={items[1].title}
        amount={items[1].amount}
        date={items[1].date}
      ></Expenseitems>
      <Expenseitems
        title={items[2].title}
        amount={items[2].amount}
        date={items[2].date}
      ></Expenseitems>
      <Expenseitems
        title={items[3].title}
        amount={items[3].amount}
        date={items[3].date}
      ></Expenseitems>
    </div>
  );
}

export default items;
